import React from 'react'
import Slider from 'react-slick'

import './olahraga.css'
import 'slick-carousel/slick/slick.css'
import 'slick-carousel/slick/slick-theme.css'

import { KometisiList } from '../../components/index'
import tes from '../../assets/tes.png'

const olahragaData = [
  {
    seniImage: tes,
    seniName: 'Seni 1'
},
{
    seniImage: tes,
    seniName: 'Seni 2'
},
{
    seniImage: tes,
    seniName: 'Seni 3'
},
{
    seniImage: tes,
    seniName: 'Seni 4'
},
{
    seniImage: tes,
    seniName: 'Seni 5'
},
{
    seniImage: tes,
    seniName: 'Seni 6'
},
{
    seniImage: tes,
    seniName: 'Seni 7'
},
{
    seniImage: tes,
    seniName: 'Seni 8'
},
{
    seniImage: tes,
    seniName: 'Seni 9'
},
]

const Olahraga = () => {
  return (
    <div className='spirit__kompetisi_olahraga section__padding' id='olahraga'>
        <div className='spirit__kompetisi-heading_olahraga'>
            <h1>OLAHRAGA</h1>
        </div>
        <div className='spirit__kompetisi_olahraga-container'>
            {olahragaData.map((item, index) => (
              <KometisiList kompetisiImage={item.olahragaImage} kompetisiName={item.olahragaName} />
            ))}
        </div>
    </div>
  )
}

export default Olahraga
